CREATE DEFINER=`root`@`%` PROCEDURE `Archive` (IN `Today` DATE)   BEGIN
	INSERT into OrdersArchive(idOrder, Date, OrderPrice, Quantity, City, Street, Status, idGood, idUser) 
		select * from Orders
		WHERE DATE < DATE_SUB(Today, INTERVAL 1 MONTH) AND Status = 1;

	SET SQL_SAFE_UPDATES = 0;
    
	DELETE FROM Orders
		WHERE DATE < DATE_SUB(Today, INTERVAL 1 MONTH) AND Status = 1;
END$$

CREATE DEFINER=`root`@`%` PROCEDURE `PriceOfProduct` (IN `GoodId` INT, IN `UserId` INT, OUT `productPrice` FLOAT)   SELECT SumPrice INTO productPrice FROM ShoppingBag WHERE idGood = GoodId AND idUser = UserId$$

CREATE DEFINER=`root`@`%` PROCEDURE `QuantityOfProduct` (IN `GoodId` INT, IN `UserId` INT, OUT `productQuantity` INT)   SELECT Quantity INTO productQuantity FROM ShoppingBag WHERE idGood = GoodId AND idUser = UserId$$

CREATE DEFINER=`root`@`%` PROCEDURE `ShoppingBagByUserIdAndGoodId` (IN `GoodId` INT, IN `UserId` INT, OUT `result` INT)   SELECT EXISTS(SELECT * FROM ShoppingBag WHERE idGood = GoodId AND idUser = UserId) INTO result$$

